sys_variable_value.value:
(function execute(inputs, outputs) {
    try{
        var re = inputs.flags?new RegExp(inputs.regex,inputs.flags):new RegExp(inputs.regex);//example new RegExp("ab+c", "i")
        outputs.is_match = re.test(inputs.inputstring)
    }
    catch(e){
        outputs.is_match = false;
    }

})(inputs, outputs);

